(()=>{"use strict";window.onload=()=>{!async function(e){fetch("http://api.openweathermap.org/data/2.5/weather?q="+e+"&APPID=44417ab558331b507b15ba59e307962f",{mode:"cors"}).then((e=>e.json())).then((e=>{!function(e){Math.round(parseFloat(e.main.temp)-273.15);const t=Math.round(1.8*(parseFloat(e.main.temp)-273.15)+32);document.getElementById("description").innerHTML=e.weather[0].description,document.getElementById("temp").innerHTML=t+"&deg",document.getElementById("location").innerHTML=e.name}(e)})).catch((()=>{console.log("error")}))}("Austin")}})();